import { Button, Switch } from 'antd';
import './App.css';
import Navbar from '../../lyricfinder/src/components/layout/Navbar';
import Lyrics from '../../lyricfinder/src/components/tracks/Lyrics';

const App = () => (
  <ContextProvider>
    <Router>
      <>
        <Navbar />
        <div className='container'>
          <Switch>
            <Route exact path="/" component={Index}/>
            <Route exact path="/lyrics/tract/:id" component={Lyrics}/>
          </Switch>
        </div>
      </>
    </Router>
  </ContextProvider>
);

export default App;
